define view entity YEHO_DDL_I_DELETE_RECEIPT_HD
  as select from    yeho_t_offlinebd as header
//    inner join      yeho_t_offlinedt as item on  item.companycode             = header.companycode
//                                             and item.glaccount               = header.glaccount
//                                             and item.physical_operation_date = header.valid_from
    left outer join yeho_t_savedrcpt as docs on  docs.companycode             = header.companycode
                                             and docs.glaccount               = header.glaccount
//                                             and docs.receipt_no              = item.receipt_no
                                             and docs.physical_operation_date = header.valid_from
{
  key header.companycode,
  key header.glaccount,
  key header.valid_from as physical_operation_date,
  count( distinct( docs.accountingdocument ) ) as docnumber
//      case  when ( docs.accountingdocument is initial or docs.accountingdocument is null ) then '' else 'X' end as deleteable 
}  group by header.companycode, header.glaccount , header.valid_from 
